import React from "react";
import { Link } from "react-router-dom";
import icon from "../Resimler/Süperlig_logo.png"


const Hesap_olusturma = () => {
    return (
        <div>
            <div className="Profil-cercevesi">
                <div className="Profil-cerceve-ici">
                    <div className="orta">
                        <img src={icon} width="70" />
                    </div><br />
                    <p style={{ textAlign: "center" }}>Zaten bir hasabınız var mı? Giriş Yap</p>


                </div>

            </div>
        </div>
    )
}

export default Hesap_olusturma;
